import axios from "axios";
import config, { apiUrl } from "./config";

axios.defaults.baseURL = config.apiUrl;

export const getAtl = wholeUrl => {
    const requestUrl = apiUrl + wholeUrl;
    return axios.get(requestUrl)
};
